// main.jsx
import React, { useState } from 'react';
import axios from 'axios';
import './main.css';

const Main = () => {
    const [formData, setFormData] = useState({
        name: '',
        area: '',
        landOptions: '',
        materials: []
    });
    const [predictedPrice, setPredictedPrice] = useState(null);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleMaterialsChange = (e) => {
        const { value, checked } = e.target;
        setFormData((prevData) => {
            const materials = checked
                ? [...prevData.materials, value]
                : prevData.materials.filter((material) => material !== value);
            return { ...prevData, materials };
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post('/api/predict-price', formData);
            setPredictedPrice(response.data.price);
        } catch (error) {
            console.error('Error predicting price:', error);
        }
    };

    return (
        <div className="main-container">
            <header className="header">
                <h1>Welcome to Opex Home Solutions</h1>
                <p>Your one-stop destination for beautiful and functional home designs.</p>
            </header>
            
            <section className="features">
                <h2>Our Features</h2>
                <ul>
                    <li>Wide range of house designs including Villas, Bungalows, Apartments, and more.</li>
                    <li>Customizable options based on your preferences and land choices.</li>
                    <li>AI-powered price prediction for your dream home.</li>
                    <li>Real-time contractor and material sourcing options.</li>
                </ul>
            </section>
            
            <section className="price-prediction">
                <h2>Get a Price Estimate</h2>
                <form onSubmit={handleSubmit} className="price-form">
                    <label>
                        House Design Name:
                        <select name="name" value={formData.name} onChange={handleChange} required>
                            <option value="">Select</option>
                            <option value="Bungalow">Bungalow</option>
                            <option value="Villa">Villa</option>
                            <option value="Appartment">Appartment</option>
                        </select>
                    </label>
                    <label>
                        Area (in sqft):
                        <select name="area" value={formData.area} onChange={handleChange} required>
                            <option value="">Select</option>
                            <option value="500-1000">500-1000</option>
                            <option value="1000-1500">1000-1500</option>
                            <option value="1500-2000">1500-2000</option>
                            <option value="2000-2500">2000-2500</option>
                            <option value="2500-3000">2500-3000</option>
                            <option value="3000-3500">3000-3500</option>
                            <option value="3500-4000">3500-4000</option>
                            <option value="4000-6000">4000-6000</option>
                            <option value="6000-10000">6000-10000</option>
                        </select>
                    </label>
                    <label>
                        Land Options:
                        <select name="landOptions" value={formData.landOptions} onChange={handleChange} required>
                            <option value="">Select</option>
                            <option value="Urban">Urban</option>
                            <option value="Suburban">Suburban</option>
                            <option value="Rural">Rural</option>
                        </select>
                    </label>
                    <label>
                        Materials Required:
                        <div className="materials-options">
                            <label>
                                <input type="checkbox" value="Cement" onChange={handleMaterialsChange} />
                                Cement
                            </label>
                            <label>
                                <input type="checkbox" value="Concrete" onChange={handleMaterialsChange} />
                                Concrete
                            </label>
                            <label>
                                <input type="checkbox" value="Wood" onChange={handleMaterialsChange} />
                                Wood
                            </label>
                            <label>
                                <input type="checkbox" value="Glass" onChange={handleMaterialsChange} />
                                Glass
                            </label>
                            <label>
                                <input type="checkbox" value="Marble Tiles" onChange={handleMaterialsChange} />
                                Marble Tiles
                            </label>
                        </div>
                    </label>
                    <button type="submit">Get Price Prediction</button>
                </form>
                {predictedPrice && (
                    <div className="result">
                        <h3>Predicted Price: â‚¹{predictedPrice}</h3>
                    </div>
                )}
            </section>
        </div>
    );
};

export default Main;
